delete    FROM     stklist where acctid in('000011721201','000011725201','000011723201') and stkid in ('100213','109644','109517','109516');
delete from unduerepurchasebonds  where   stkid in ('100213','109644','109517','109516');
delete from unduerepurchasebondshis  where   stkid in ('100213','109644','109517','109516'); 
delete from openorder where    stkid in ('100213','109644','109517','109516'); 
update openorder  a  set  a.occurtime=(select    substr(b.tradedate,0,8)||substr(a.occurtime,9,14)       from sysconfig b )  where   stkid in ('100213','109644','109517','109516'); 
update openorder  a  set  a.offertime=(select    substr(b.tradedate,0,8)||substr(a.offertime,9,14)       from sysconfig b )  where   stkid in ('100213','109644','109517','109516'); 
update  openorder  a  set  a.ordertime=(select    substr(b.tradedate,0,8)||substr(a.ordertime,9,14)       from sysconfig b ) where   stkid in ('100213','109644','109517','109516'); 
